import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Menu from "./components/Menu"; // Asegúrate de importar correctamente
import Productos from "./components/Productos"; // Importa el componente de productos
import Proveedores from "./components/Proveedores"; // Importa el componente de proveedores

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Menu />} /> {/* Ruta para el menú */}
        <Route path="/productos" element={<Productos />} /> {/* Ruta para productos */}
        <Route path="/proveedores" element={<Proveedores />} /> {/* Ruta para proveedores */}
      </Routes>
    </Router>
  );
}

export default App;
